(14, 'AlbertRap', 'canapphettlinger@yahoo.com', NULL, 'The prostate gland is an essential a part of a males reproductive :. It secretes fluids that assist the transportation and activation of sperm. The prostate related is situated just before the rectum, below the bladder and around the urethra. When there is prostate problem, in most cases really miserable and inconvenient to the patient as his urinary method is directly affected. \r\n \r\nThe common prostate health conditions are prostate infection, enlarged prostate and prostate cancer. \r\n \r\n \r\n \r\nProstate infection, also known as prostatitis, is regarded as the common prostate-related problem in men younger than 55 yrs . old. Infections with the prostate are classified into four types - acute bacterial prostatitis, chronic bacterial prostatitis, chronic abacterial prostatitis and prosttodynia. \r\n \r\nAcute bacterial prostatitis may be the least common of most types of prostate infection. It is due to bacteria perfectly located at the large intestines or urinary tract. Patients may experience fever, chills, body aches, back pains and urination problems. This condition is treated through the use of antibiotics or non-steroid anti-inflammatory drugs (NSAIDs) to help remedy the swelling. \r\n \r\nChronic bacterial prostatitis is really a condition associated with a particular defect inside gland along with the persistence presence of bacteria in the urinary tract. It can be brought on by trauma for the urinary tract or by infections originating from other regions of the body. A patient may feel testicular pain, spine pains and urination problems. Although it is uncommon, it is usually treated by removal in the prostate defect as well as the employment antibiotics and NSAIDs to treat the redness. \r\n \r\nNon-bacterial prostatitis makes up about approximately 90% of all prostatitis cases; however, researchers have not to ascertain the cause of these conditions. Some researchers believe that chronic non-bacterial prostatitis occur as a consequence of unknown infectious agents while other think that intensive exercise and high lifting can cause these infections. \r\n \r\nMaintaining a Healthy Prostate \r\n \r\nTo prevent prostate diseases, an appropriate weight loss program is important. These are some in the actions you can take to keep your prostate healthy. \r\n \r\n1. Drink sufficient water. Proper hydration is critical for general health and itll also keep the urinary track clean. \r\n \r\n2. Some studies suggest that a couple of ejaculations each week will assist to prevent prostate cancer. \r\n \r\n3. Eat steak without excess. It has been shown that consuming a lot more than four meals of beef weekly will raise the likelihood of prostate diseases and cancer. \r\n \r\n4. Maintain an appropriate diet with cereals, vegetable and fruits to make sure sufficient intake of nutrients essential for prostate health. \r\n \r\nThe most important measure to look at to make sure a proper prostate is to go for regular prostate health screening. If you are forty years of age and above, you ought to choose prostate examination at least once 12 months.', '2018-07-13 17:24:43', 0),
