(48, 'Princess Suite', '<p>Princess Suites are one of our guests favourite rooms here. It has about 110 square meter area, separate living room, separate powder room and a 42&quot; plasma TV. &nbsp;Also we have a new favourite here, a Prince Suite, a cozy &nbsp;suite room with a view. Since these rooms are limited in quantity, please reserve your arrival ahead. We look forward to serve you here.</p>\r\n', 'Rp. 1.500.000,-', '2018-04-25 09:26:03', 14, 'Room_H', 34, 'Princess Suite', 0, 'PrincessSute0011.jpg', 1, 'Administrator', 0, 'princess-suite', 0),
(49, 'Prince Suite', '<p>Prince&nbsp;Suites are one of our guests favourite rooms here. It has about 110 square meter area, separate living room, separate powder room and a 42&quot; plasma TV. &nbsp;Also we have a new favourite here, a Prince Suite, a cozy &nbsp;suite room with a view. Since these rooms are limited in quantity, please reserve your arrival ahead. We look forward to serve you here.</p>\r\n', 'Rp. 1.100.000,-', '2018-04-25 09:28:13', 14, 'Room_H', 33, 'Prince Suite', 0, 'PrinceSuite001.jpg', 1, 'Administrator', 0, 'prince-suite', 0),
(50, 'Junior Suite', '<p>Junior Suites are perfect choice for our guests who valued their space in a comfortable room. The room averages at 28 sq m.</p>\r\n', 'Rp. 799.000,-', '2018-04-25 09:29:31', 14, 'Room_H', 32, 'Junior Suite', 0, 'JuniorSuite001.jpg', 1, 'Administrator', 0, 'junior-suite', 0),
(53, 'Premiere Suite', '<p>Premiere&nbsp;Suite is dedicated for business traveler, it has a spacious 32 square meter, a work desk, and bright lighting for your work</p>\r\n', 'Rp. 755.000,-', '2018-04-25 09:45:26', 14, 'Room_H', 31, 'Premiere', 0, 'Premiere001.jpg', 1, 'Administrator', 0, 'premiere-suite', 0),
(54, 'NeoPC', '<p>NeoPC is the place to relax and enjoy Palembang&rsquo;s Clubbing scene. Currently one of the liveliest club in the city...</p>\r\n', '', '2018-04-26 08:46:51', 15, 'Home_service_1', 0, '', 0, 'DSC01059_(Large).jpeg', 1, 'Administrator', 0, 'neopc', 0),
(55, 'Putri Selako', '<p>All time favourites Nasi Goreng ikan Asin (Salted Fish Fried Rice), Sop Buntut (Oxtail Soup), Nasi Goreng Buntut (Oxtail Fried Rice) &amp; many menus are waiting for you...</p>\r\n', '', '2018-04-26 08:51:07', 16, 'Home_service_2', 0, '', 0, 'DSC01103_(Large)1.jpeg', 1, 'Administrator', 0, 'putri-selako', 0),
(56, 'Meeting', '<p>You can rent a place for a meeting...</p>\r\n', '', '2018-04-26 08:51:45', 17, 'Home_service_3', 0, '', 0, 'DSC00162_(Large).jpeg', 1, 'Administrator', 0, 'meeting', 0),
(57, 'Gathering & Banquets', '<p>You can rent a place for a Gathering &amp; Banquets...</p>\r\n', '', '2018-04-26 08:53:04', 18, 'Home_service_4', 0, '', 0, 'DSC00126_(Large).jpeg', 1, 'Administrator', 0, 'gathering-&-banquets', 0),
