(61, 'wings@terrace', '<p>Wings@terrace is the first Beer Garden and Chicken Wings outpost in the City. We serve the best chicken wings in town and cold freezin&#39; beers.&nbsp;</p>\r\n\r\n<p>There are live music nightly and smooth chillin&#39; out DJs completes your night out to relax. There are indoor area where it&#39;s air conditioned and outdoor area where all the fun starts; we even have a Pool table for your use.</p>\r\n', '', '2018-04-27 07:45:40', 22, 'wing_terrace', 19, 'Wing_Terrace', 0, 'DSC01067_(Large).jpeg', 1, 'Administrator', 0, 'wings@terrace', 0),
(65, 'NeoPC Event Space', '<p>Ruangan ini bisa dijadikan tempat unutk berkumpul dan sebagainya</p>\r\n', '', '2018-04-27 16:27:00', 23, 'MICE', 21, 'NeoPC', 0, 'DSC01053_(Large)4.jpeg', 1, 'Administrator', 0, 'neopc-event-space', 0),
(66, 'Putri Selako', '<p>Putri Selako is our 24-hour full service eateries, that serves breakfast buffett for our valued guests with local culinaries choices.&nbsp;</p>\r\n\r\n<p>We also serve various favourite food selections , eastern, western and or Indonesian favourites; and most of these menus are available for room service.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '2018-04-28 12:56:18', 24, 'cafe deskripsi', 25, 'putri_selako', 0, 'Penyetan_Ayam.jpg', 1, 'Administrator', 0, 'putri-selako', 0),
